// import logo from './logo.svg';
import React from "react";
import './App.css';
import Home from './home';
import CourseOne from "./course-one";
import CourseTwo from "./course-two";
import Contact from "./contact";

function App() {
  return (
    <div className="App">
      <Home />
      <CourseOne />
      <CourseTwo />
      <Contact />
    </div>
  );
}

export default App;
